let params = {};
if (request_vendor_parameters) {
    if (request_vendor_parameters['projectCategory.id']) {
        params.categoryId = request_vendor_parameters['projectCategory.id'];
        params['projectCategory.id'] = null;
    }
    if (request_vendor_parameters['projectTypeKey']) {
        params.typeKey = request_vendor_parameters['projectTypeKey'];
        params['projectTypeKey'] = null;
    }
    if (!request_vendor_parameters['query'] && request_vendor_parameters['name']) {
        params.query = request_vendor_parameters['name'];
        params.name = null;
    }
    if (!request_vendor_parameters['query'] && request_vendor_parameters['key']) {
        params.query = request_vendor_parameters['key'];
        params.key = null;
    }
    done({
        "request_vendor_parameters": params
    });
}
done();

if (response_body && response_body.self) {
	let id = response_body.self.split('/').pop();
	configuration['jira.hooks.id'] = id;
	done({
		"configuration": configuration
	});
} else {
	done();	
}

var path; 
var body = {}; 
var method; 
var expressionQuery = request_expression; 
var request_param = {}; 
var req_param = []; 
if (expressionQuery == null || expressionQuery == 'undefined') { 
 done({ 
 "response_body": { 
 "error": "Invalid query expression. A CEQL search expression should be in the form key='value'" 
 }, 
 "response_status_code": 400, 
 "continue": false 
 }) 
} 

for (var i = 0; i < expressionQuery.length; i++) { 

 req_param[i] = expressionQuery[i].attribute; 
 if (req_param[i] == 'deleted' || req_param[i]=='updated') { 
 if (expressionQuery[i].value == 'false') { 
 done({ 
 "response_body": { 
 "error": "Only true is supported for updated and deleted parameters" 
 }, 
 "response_status_code": 400, 
 "continue": false 
 }) 

 } 
 } 

} 
if ((!req_param.includes('id')) && (!req_param.includes('updated')) && (!req_param.includes('deleted'))) { 
 done({ 
 "response_body": { 
 "error": "Invalid filter. Either id, deleted or updated is required" 
 }, 
 "response_status_code": 400, 
 "continue": false 
 }) 
} 

if ((req_param.includes('id') && req_param.includes('updated')) || 
 (req_param.includes('id') && req_param.includes('deleted')) || 
 (req_param.includes('deleted') && req_param.includes('updated')) || 
 (req_param.includes('id') && req_param.includes('updated') && req_param.includes('deleted'))) { 
 done({ 
 "response_body": { 
 "error": "Only one of the parameters from id, deleted or updated are supported at a time" 
 }, 
 "response_status_code": 400, 
 "continue": false 
 }) 
} 

request_param = request_vendor_parameters; 
for (var i = 0; i < expressionQuery.length; i++) { 
 var key = expressionQuery[i].attribute; 
 var value = expressionQuery[i].value; 
 if (key === 'id') { 
 var temp = value.split(",").map(idValue => parseInt(idValue, 10)); 
body = { 
 "ids": temp 
} 
 path = "/rest/api/2/worklog/list"; 
 method = "POST"; 

 } 
 else if (key === 'deleted') { 
 path = "/rest/api/2/worklog/deleted"; 
 method = "GET"; 
 body = null; 
 } else if (key === 'updated') { 
 path = "/rest/api/2/worklog/updated"; 
 method = "GET"; 
 body = null; 
 }else if (key === 'expand') { 
 request_param[key] = value.split(",").map(prop => prop.trim()).join(','); 
 } 
 else { 
 request_param[key] = value; 
 } 
} 
request_param['where'] = null; 
done({ 
 "request_vendor_path": path, 
 "request_vendor_body": body, 
 "request_vendor_method": method, 
 "request_vendor_parameters": request_param 
})
